The glue of the anthology - “The Cheerleaders Wraparound”. These ladies are magical beings embodying a complicated history of cheerleaders to guide our anthology journey for women’s rights. This was our first day of filming with less than 3 (THREE!!) weeks from the inception of “Give Me An A”! I knew if we could get this wraparound shot, we could do the rest, and if we couldn’t, we’d have lost hope before we even got started and that would be the end of it. This was scheduled to be filmed on a football field but the permit was declined about 24 hours before filming, within one day the whole team took a 180 to an empty stage. We built a locker room day-of, changed the story to fit our weird new space, had no prep. Bless this team for showing up in a big way and with a lot angry momentum to give women a voice and fight for women’s rights and reproductive rights. Bless the people who stepped in last minute. (Like @virginiamadsen the day before - thank you so freaking much, @meganrosati, @cherokeepresley, @theashleypeony) I cry every time I look back at this day and knowing everyone who showed up this day was carrying so much important momentum to kick off this project. This whole film should have been impossible, but the people here this day made sure it would happen. Thank you @keslowcamera especially for rallying for us!!! Without you, we wouldn’t have done this. 
