Headed to @fantaspoa in Brazil with @givemeanafilm! In Brazil, abortion is a crime that carries a prison sentence - with the exceptions of rape and risk to a woman’s life (these exceptions were made in the 1940s). One in 5 women in Brazil below the age of 40 have had at least 1 illegal abortion - almost half are admitted to hospitals for post-abortion care. Latin America historically has some of the most stringent abortion laws in the world. In 2020 Argentina led the green wave and legalized abortion up to 14 weeks of pregnancy, in 2021 Mexico decriminalized abortion and now permits abortion in the first 12 weeks, in 2022 Columbia ruled that abortion bans were unconstitutional and now allow abortions up to 24 weeks. (Worth noting, feminists in Latin America have been fighting for abortion rights since the 70s, Cuba legalized abortion in 1961 and Guyana and Uruguay in 1995 and 2012.) we are so grateful to @fantaspoa @jpfantaspoafleck for welcoming us and hosting us! 💚💚💚
P.S. here’s my absolute favorite photo of me from set by @rejano - no, I didn’t wear wings all day, but we were crunched for time and needed to test a shot while the actors were in makeup. #womensrights #reproductiverights #reproductiverightsarehumanrights #reproductiverightsforall 
